/* eslint-disable */

import { useLocation } from "react-router-dom";
import ResultStat from "./Result/ResultStat";
import Campaign from "./Result/Campaign";
import { useEffect, useState } from "react";
import Loading from "./Loading";

function Result() {
  const location = useLocation();
  const [loading, setLoading] = useState(true);

  //직접 주소로 접속했을때
  if (location.state == null) {
    return <h1>Page not found.</h1>;
  }

  const breed = location.state.breed;
  const typeSelect = location.state.typeSelect;

  const offLoading = () => {
    setLoading(false);
    console.log("asdf");
  };

  useEffect(api(), []);

  const element = () => {
    <div>
      <ResultStat
        breed={breed}
        typeSelect={typeSelect}
        offLoading={offLoading}
      />

      <Campaign typeSelect={typeSelect} />
    </div>;
  };

  const api = async () => {
    var url = "http://127.0.0.1:8000/api/dog";

    axios
      .get(url, {
        params: { breed: "푸들" },
      })
      .then((response) => {
        const searchResults = response.data;
        console.log(searchResults[0]);
        setLoading(false);
      });
  };

  return <>{loading ? <Loading /> : { element }}</>;
}

export default Result;
